;define("/modules/tpl/contractInfo.tpl_tpl",function(require,exports,module){return function(it,opt){with(it=it||{}){var _$out_=[];return _$out_.push('<style>.con-info strong{font-weight:bold!important;}.con-info .warning {color: #E80806;}</style><div class="con-info" unselectable="on" style="-moz-user-select:none;-webkit-user-select:none;" onselectstart="return false;"><p class="pro-title">《腾讯课堂课程发布者注册协议》之收益补充协议</p><p><br/></p><p class="pro-guide"><strong> 甲&nbsp;&nbsp;&nbsp;方：深圳市腾讯计算机系统有限公司（以下又称“腾讯”）</strong></p><p class="pro-no-indent">地&nbsp;&nbsp;&nbsp;址：深圳市科技中一路腾讯大厦</p><p><br/></p><p class="pro-guide">乙&nbsp;&nbsp;&nbsp;方：',bill.account||bill.bank_owner,'</p><p class="pro-no-indent">地&nbsp;&nbsp;&nbsp;址：',bill.address||bill.bank_address,'</p><p class="pro-no-indent">联系人：',bill.contact||bill.bank_contact,'</p><p class="pro-no-indent">手&nbsp;&nbsp;&nbsp;机：',bill.pro_phone,'</p><p class="pro-no-indent">电子邮箱：',bill.pro_mail,'</p><p><br/></p><p class="pro-guide"><strong> 丙&nbsp;&nbsp;&nbsp;方：财付通支付科技有限公司</strong></p><p class="pro-no-indent">地&nbsp;&nbsp;&nbsp;址：深圳市南山区高新科技园科技中一路腾讯大厦8层</p> <p><br/></p><p class="pro-guide"><strong>一、特别说明：</strong></p><u><strong><p>1、关联协议：本协议（以下或称“收益补充协议”）是《腾讯课堂课程发布者注册协议》（下称：主协议）的补充协议，《腾讯课堂课程奖惩规则》和《腾讯课堂处罚规则》是本协议的重要组成部分，乙方同意并承诺遵守前述所有协议规则的约束。乙方同意，腾讯（或称“甲方”，下同）有权根据实际情况的变化新增或调整本补充协议内容，新规则将提前七天通过网页公告、电子邮件、手机短信等方式予以公布，一经公布即对乙方产生法律约束力。前述协议条款有冲突的，腾讯有权选择适用。</p><p>2、纠纷处理：乙方理解并同意：因课程内容等问题引发的任何学员投诉和纠纷（包括但不限于课程质量问题、课程内容侵权问题等），腾讯有权将乙方的联系人、联系方式等信息同步给学员或权利人，乙方应该在收到腾讯通知（包括但不限于电话、短信、电子邮件、网页公告等方式）后七个工作日内处理完毕，并将处理结果书面告知腾讯。如果七个工作日内没有解决纠纷或者没有任何回复，腾讯有权向财付通账户发送止付指令，限制乙方相关未结算费用提现并代乙方向学员退费（由于腾讯课堂拥有数量庞大的用户群体，商业声誉价值巨大，乙方对任何纠纷的处理不当将对腾讯课堂声誉造成重大不利影响和难以估价的商誉损失，因此，腾讯针对投诉人数多或者其他严重情节的纠纷，有权基于自身的判断进行全额退款）或向权利人进行赔偿，腾讯代为退费或赔偿后有权向乙方追偿。情节严重者，腾讯有权下架乙方所有课程并终止合作（课程下架后，腾讯有权代乙方向学员进行退费，并有权向乙方追偿），由此引发的任何损失由乙方承担。</p><p>3、追偿权利：由于乙方原因导致甲方遭受任何损失，在乙方不积极履行赔付义务时，甲方有权限制其关联公司的款项并向乙方的关联公司追偿。关联公司，指的是控制乙方，或被乙方所控制，或与乙方共同受控制于同一实体的任何企业，控制是指直接或间接拥有乙方百分之五十（50％）以上的股权、投票权或管理权，或通过协议控制乙方管理权。</p><p>4、协议期限：自',bill.curYear,"年",bill.curMonth,"月",bill.curDay,"日至",bill.endYear,"年",bill.endMonth,"月",bill.endDay,'日，期限届满前，任何一方均未提出书面终止要求的，则本协议有效期顺延一年，顺延次数不限。</p><p>5、管辖法院：本协议产生的任何法律纠纷双方同意提交本协议签订地深圳市南山区有管辖权的人民法院诉讼解决。</p></u></strong><p><br/></p><p class="pro-guide"><strong>二、甲方权利义务 </strong></p><p>1、甲方有权根据甲方公布的相关规则、规范对乙方课程的运营质量进行考核。</p><p>2、甲方有权根据甲方公布的相关规则、规范对乙方课程进行管理，且保留对规则的修改和解释权，乙方课程不符合规则或相关法律法规的，甲方有权停止乙方课程的运营、支付等相关服务。</p><p>3、乙方课程符合甲方公布的相关规则、规范后，甲方会按照相关约定、规则等为乙方收费课程的发布和充值支付渠道等提供相关技术支持服务。</p><p><strong>4、在乙方课程产生收益后，甲方有权按照本协议约定，向乙方收取技术服务费。此外，如用户经iOS支付渠道支付乙方课程费用的，甲方将代乙方向苹果公司支付iOS支付渠道费，此费用包括苹果公司收取的用户经苹果iOS支付渠道实际支付乙方课程费用所产生的直接渠道费用及苹果公司与甲方实际结算该等课程费用所产生的结算差异（或又称间接渠道费用）。甲方有权根据整体运营情况，单方决定是否增加、调整技术服务费、iOS支付渠道费的内容和收费标准，但甲方会提前通知乙方。乙方如果不同意相关规则的修订调整，应停止使用甲方提供的本协议约定的服务，对于已经在架且正在上课的课程，乙方有义务履行授课义务直至课程结束。若乙方继续使用甲方提供的本协议约定的服务进行招生或开设新的课程，则表示乙方同意和愿意遵守修改后的收费标准等内容。。</strong></p><p>5、甲方有权要求乙方积极配合甲方腾讯课堂运营需要所开展的推广活动。</p> <p> 6、乙方理解并同意，无论任何原因，单一授权甲方向财付通账户发送查询、划转指令，若用户未实际向乙方支付课程费用的，甲方有权拒绝向财付通账户发送支付相关乙方课程费用所对应的收益款项的指令，乙方不得擅自进行划转，具体结算数据以腾讯提供的数据为准。 </p> <p><strong> 7、甲方有权根据本协议以及其他已经发布的规则，基于自身独立判断或者用户投诉，对乙方的课程是否符合质量要求进行判定。如认为乙方课程质量不符合要求，则甲方有权单方终止本协议并将乙方课程予以下线，且有权向财付通账户发送尚未支付给乙方的相应款项的止付指令，并向财付通账户发送应当退还给用户以及补偿用户的损失等费用对应款项的止付指令。若乙方对应款项不足，则甲方有权向乙方或乙方关联公司追偿，或者从其他任何应支付给乙方或乙方关联公司的已经产生的款项或即将产生的款项中予以扣除。 </strong></p><p><br/></p><p class="pro-guide"><strong>三、乙方权利义务</strong></p><p>1、乙方有权自行决定发布课程是否收费、课程收费标准及课程收费方式等形式，但不得随意变动课程价格，且应该遵守甲方的相关规则。</p><p>2、自乙方课程开始向用户收费并产生课程收益开始，乙方依约获得其应得的课程收益，甲方作为中立的平台方，为乙方向用户提供的课程服务提供相应的平台和技术支持服务，并依本协议约定获得乙方向甲方支付的相关技术服务费用。 此外，如用户经iOS支付渠道支付乙方课程费用的，甲方将代乙方向苹果公司支付iOS支付渠道费。</p><p><strong> 3、如乙方课程是向用户收费的付费课程，乙方同意除在甲方同意或授权的情况下，乙方需通过甲方已经提供的在线支付方式进行支付，乙方仅使用甲方提供的充值支付渠道或苹果iOS支付渠道（当用户使用iOS版本的腾讯课堂客户端软件进行支付时）作为课程的充值支付渠道，且不可单独开发或向用户提供除甲方提供的充值支付渠道或苹果iOS支付渠道之外的任何充值支付渠道。如乙方在未经甲方同意或授权的情况下，使用甲方提供的充值支付渠道及苹果iOS支付渠道以外的任何渠道面向用户进行收费的，甲方有权随时中止、终止乙方在甲方平台上的运营、有权向财付通账户发送对乙方全部课程收益止付的指令。并索要违约金。</strong></p><p><u><strong>4、乙方不得引导学员到腾讯以外的任何渠道进行学习或支付等，一经发现的，甲方有权立即终止同乙方的合作，乙方应该参照本协议约定条款解决课程被下架后的纠纷。</u></strong></p><p><u><strong>5、乙方课程因违反相关法律法规或甲方相关规则被下架的，则乙方应该依据本协议相关条款妥善解决与学员的纠纷，否则，腾讯有权代为退费或赔偿，并有权向乙方或乙方在腾讯的其他关联公司进行追偿。</u></strong></p><p>6、 乙方有义务遵守主协议、本补充协议、其他双方签署的相关协议及相关附件、规则、规范等及相关法规等。否则，甲方有权随时中止、终止乙方在甲方平台上的运营或提供相关服务，且乙方需承担因此对甲方及用户造成的一切损失。</p><p>7、乙方可以按照相关约定、规则等使用由甲方提供的针对课程及用户的数据统计分析系统、反外挂数据分析系统。</p><p>8、乙方须保证向用户提供有效和优质的服务，包括但不限于提供24小时的客服电话服务等并保证服务质量，若乙方无法确保此条，经甲方书面同意后，可以接入甲方提供的客服系统，但涉及到的人员及人员的人力成本等相关费用由乙方自行解决和承担。</p><p>9、乙方同意会积极配合甲方开展的推广活动。</p><p>10、乙方同意在此授权甲方可在腾讯课堂或其他平台、渠道等为乙方进行课程内容的宣传推广，使用与乙方课程内容相关的知识产权。</p><p>11、如乙方聘任第三方（以QQ号码或微信账号为标识）进行相关课程交流的，则视第三方行为为乙方自身履行课程的行为，乙方应当对该第三方的相关行为承担责任（包括但不限于管理第三方的课程安排、支付第三方相应费用等）。如该第三方存在违反法律法规或甲方相关规定的行为，则视同乙方违反法律法规或甲方相关规定，甲方有权根据相关法律法规或甲方相关规定对乙方进行相应的处罚。</p><p><br/></p><p class="pro-guide"><strong>四、乙方课程收益计算</strong></p><p>（一）本协议涉及的费用一律以人民币为计量单位。</p><p>（二）甲方向乙方相应收取用户实际支付乙方课程费用所对应的<strong>技术服务费</strong>。如用户经iOS支付渠道支付乙方课程费用的，则甲方将代乙方向苹果公司支付<strong>iOS支付渠道费</strong>，详细计算如下：</p><p><strong>1、技术服务费：</strong>甲方向乙方收取的技术服务费率分为<strong>10%、5%、2.5%</strong>三档, 其中：</p><p><strong>(1) IT互联网、电商营销、设计创作、兴趣生活类目，就任何自然年度：</strong></p><p>用户通过所有支付渠道实际支付的该类目下乙方课程总费用（从每个自然年度1月1日开始计算，包括所有非苹果iOS支付渠道与苹果iOS支付渠道）低于人民币2000万元（大写：贰仟万元 整），则甲方向乙方收取用户通过所有支付渠道实际支付的该类目下乙方课程费用的10%作为技术服务费，其中：</p><p>- 如用户通过非苹果iOS支付渠道支付该类目下乙方课程费用的，则甲方向乙方收取用户通过非苹果iOS支付渠道实际支付的该类目下乙方课程费用的10%作为技术服务费；</p><p>- 如用户通过苹果iOS支付渠道支付该类目下乙方课程费用的，则甲方向乙方收取(a)用户通过苹果iOS支付渠道实际支付的该类目下乙方课程费用，减去(b)该课程费用所对应的iOS支付渠道费后剩余课程费用的10%作为技术服务费；</p><p>若用户通过所有支付渠道实际支付的该类目下乙方课程总费用（从每个自然年度1月1日开始计算，包括所有非苹果iOS支付渠道与苹果iOS支付渠道）超过人民币2000万元（大写：贰仟万元 整），<strong>则自该自然年度乙方该类目下课程总费用超过2000万元开始，甲方向乙方收取用户通过所有支付渠道实际支付的该类目下乙方课程费用的5%作为技术服务费，其中：</strong></p><p>- 如用户通过非苹果iOS支付渠道支付该类目下乙方课程费用的，则甲方向乙方收取用户通过非苹果iOS支付渠道实际支付的该类目下乙方课程费用的5%作为技术服务费；</p><p>- 如用户通过苹果iOS支付渠道支付该类目下乙方课程费用的，则甲方向乙方收取(a)用户通过苹果iOS支付渠道实际支付的该类目下乙方课程费用，减去(b)该课程费用所对应的iOS支付渠道费后剩余课程费用的5%作为技术服务费；</p><br/><p><strong>(2) 职业考证、升学考研、语言留学类目，就任何自然年度：</strong></p><p>用户通过所有支付渠道实际支付的该类目下乙方课程总费用（从每个自然年度1月1日开始计算，包括所有非苹果iOS支付渠道与苹果iOS支付渠道）低于人民币1000万元（大写：壹仟万元 整），<strong>则甲方向乙方收取用户通过所有支付渠道实际支付的该类目下乙方课程费用的10%作为技术服务费，其中：</strong></p><p>- 如用户通过非苹果iOS支付渠道支付该类目下乙方课程费用的，则甲方向乙方收取用户通过非苹果iOS支付渠道实际支付的该类目下乙方课程费用的10%作为技术服务费；</p><p>- 如用户通过苹果iOS支付渠道支付该类目下乙方课程费用的，则甲方向乙方收取(a)用户通过苹果iOS支付渠道实际支付的该类目下乙方课程费用，减去(b)该课程费用所对应的iOS支付渠道费后剩余课程费用的10%作为技术服务费；</p><br/><p>若用户通过所有支付渠道实际支付的该类目下乙方课程总费用（从每个自然年度1月1日开始计算，包括所有非苹果iOS支付渠道与苹果iOS支付渠道）超过人民币1000万元（大写：壹仟万元 整）但低于人民币2000万元（大写：贰仟万元 整），<strong>则自该自然年度乙方该类目下课程总费用超过1000万元开始，甲方向乙方收取用户通过所有支付渠道实际支付的该类目下乙方课程费用的5%作为技术服务费，其中：</strong></p><p>- 如用户通过非苹果iOS支付渠道支付该类目下乙方课程费用的，则甲方向乙方收取用户通过非苹果iOS支付渠道实际支付的该类目下乙方课程费用的5%作为技术服务费；</p><p>- 如用户通过苹果iOS支付渠道支付该类目下乙方课程费用的，则甲方向乙方收取(a)用户通过苹果iOS支付渠道实际支付的该类目下乙方课程费用，减去(b)该课程费用所对应的iOS支付渠道费后剩余课程费用的5%作为技术服务费；</p><br/><p>若用户通过所有支付渠道实际支付的该类目下乙方课程总费用（从每个自然年度1月1日开始计算，包括所有非苹果iOS支付渠道与苹果iOS支付渠道）超过人民币2000万元（大写：贰仟万元 整），<strong>则自该自然年度该类目下乙方课程总费用超过2000万元开始，甲方向乙方收取用户通过所有支付渠道实际支付的该类目下乙方课程费用的2.5%作为技术服务费，其中：</strong></p><p>- 如用户通过非苹果iOS支付渠道支付该类目下乙方课程费用的，则甲方向乙方收取用户通过非苹果iOS支付渠道实际支付的该类目下乙方课程费用的2.5%作为技术服务费；</p><p>- 如用户通过苹果iOS支付渠道支付该类目下乙方课程费用的，则甲方向乙方收取(a)用户通过苹果iOS支付渠道实际支付的该类目下乙方课程费用，减去(b)该课程费用所对应的iOS支付渠道费后剩余课程费用的2.5%作为技术服务费；</p><br/><p><strong>（3）其他类目（指IT互联网、电商营销、设计创作、兴趣生活、职业考证、升学考研、语言留学类目外的任何其他类目）：甲方向乙方收取用户通过所有支付渠道实际支付的该类目下乙方课程费用的10%作为技术服务费，其中：</strong></p><p>- 如用户通过非苹果iOS支付渠道支付该类目下乙方课程费用的，则甲方向乙方收取用户通过非苹果iOS支付渠道实际支付的该类目下乙方课程费用的10%作为技术服务费；</p><p>- 如用户通过苹果iOS支付渠道支付该类目下乙方课程费用的，则甲方向乙方收取(a)用户通过苹果iOS支付渠道实际支付的该类目下乙方课程费用，减去(b)该课程费用所对应的iOS支付渠道费后剩余课程费用的10%作为技术服务费；</p><br/><p><strong>乙方课程所属类目以腾讯课堂最终确认类目为准，腾讯课堂有权视运营需求对乙方课程所属类目进行不时调整。</strong></p><br/><p>2、<strong>iOS支付渠道费</strong>：如用户经iOS支付渠道支付乙方课程费用的，则甲方将代乙方向苹果公司支付iOS支付渠道费。<strong>iOS支付渠道费=用户经iOS支付渠道实际支付乙方课程费用*iOS支付渠道费率（即：30%+X%）</strong>, 其中：</p><p>(1)<strong>30%</strong>为苹果公司收取的用户经苹果iOS支付渠道实际支付乙方课程费用所产生的直接渠道费率；</p><p>(2)<strong>X%</strong>为苹果公司与甲方实际结算用户经苹果iOS支付渠道实际支付乙方课程费用所产生的实际结算差异费率（或又称间接渠道费率）。X%的初始值设置为5%，甲方有权根据苹果公司与甲方的实际结算差异对X%进行不时的调整并于每个结算周期向乙方于腾讯课堂平台的管理后台推送的结算报告中展示实际的X%数值。如苹果公司与甲方的实际结算差异超过5%，则甲方有权于后续结算周期，从乙方的结算款项中对苹果公司多收取的iOS支付渠道费中超过5%的部分予以相应扣除。</p><br/><p>（三）<strong>乙方课程收益为</strong> (a)用户实际支付的全部乙方课程费用，减去(b)甲方向乙方相应收取的乙方课程费用对应的技术服务费，减去(c)甲方代乙方向苹果公司实际支付的iOS支付渠道费后剩余课程费用。即：</p><br/><p><strong>乙方课程收益=用户实际支付的全部乙方课程费用-甲方向乙方收取的全部技术服务费-甲方代乙方向苹果公司实际支付的iOS支付渠道费</strong></p><br/><p class="pro-guide">五、结算与支付</p><p><strong>（一）结算周期及结算金额：</strong></p><p>甲方自乙方课程向用户收取课程费用并产生收益开始，每半个自然月与乙方进行一次结算（即：每个自然月有两个结算周期）。于每个自然月的一号与十五号（如遇节假日则顺延至下一个工作日），甲方会根据截止每月一号、十五号前一日计算所有满足《腾讯课堂结算规则说明（网址：http://support.ke.qq.com/forum.php?mod=viewthread&tid=1210，如今后具体网址和相应内容有变化的，以变化后的网址和内容为准）的相应结算周期用户实际支付的乙方课程费用订单（以下简称“结算订单”）所对应的乙方课程收益金额。</p><br/><p>其中：</p><p>1、结算订单仅包括用户成功交易的订单，不包括用户已支付相应课程费用但又在符合平台退款条件的前提下成功退费的订单；</p><p>2、对于苹果iOS支付渠道所产生的结算订单，由于苹果公司实际会按照M+2结算周期向甲方进行支付，甲方会在苹果公司就相应结算订单向甲方实际支付后最近的一个结算周期， 向乙方结算并支付该等结算订单所对应的乙方课程收益金额；</p><p>3、如乙方对于用户使用某种支付渠道支付时会在所设置的原课程售卖单价的基础上给予该等用户一定的折扣，则甲方会以折扣后用户实际支付的课程费用金额来计算该等用户结算订单对应的乙方课程收益金额，具体的折扣数据以甲方系统中的数据为准。</p><br/><p>为免异议，举例说明：假设乙方设置某课程售卖单价为10元，乙方又给予使用微信支付购买该课程的用户10%的折扣。某用户使用微信支付购买该课程时实际只支付了9元（10元*（1-10%）=9元），则甲方会以9元作为该笔订单用户实际支付的课程费用金额并据此计算该订单所对应的乙方课程收益金额。</p><br/><p><strong>（二）验收与支付</strong></p><p>甲方将于每个自然月的一号与十五号（如遇节假日则顺延至下一个工作日）后第十(10)个工作日内向乙方于腾讯课堂平台的管理后台推送该个结算周期对应的乙方结算报告。甲方受乙方委托，向财付通账户发送指令，向如下乙方收款银行账户支付相应乙方课程收益款项：</p><br/><p><strong>银行账号：',bill.bank_account,"</b></strong></p><p><strong>开&nbsp;户&nbsp;&nbsp;行：",bill.bank_name,"</strong></p><p><strong>户&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;名：",bill.account||bill.bank_owner,'</strong></p><br/><p>如乙方上述指定收款银行账户信息发生变更，乙方应于甲方向财付通账户发送付款指令前至少提前十个工作日书面通知甲方变更后银行账户信息，如由于乙方没有尽到及时告知义务导致甲方付款出现问题的，相关损失由乙方承担。</p><p>如乙方对结算报告有异议，应于收到结算报告之日起（以系统推送日期为准）三十(30)个自然日内以书面形式（包括电子邮件形式）向甲方提出异议。如乙方在截止日期内未提出异议，则视为乙方对此次结算报告验收合格，无任何异议。双方应依法承担各自应当缴纳的各种税费费用，涉及代扣代缴的，甲方有权代扣代缴并提供相关凭证。</p><br/><p><strong>（三）发票</strong></p><p>甲方作为一个中立的平台方，基于向乙方提供上述平台技术服务，按第四条规定向乙方收取相应的技术服务费（iOS支付渠道费为苹果iOS支付所收取的渠道服务费，不在甲方所收取的平台技术服务费范围之内），<span class="warning">并向乙方相应开具此部分技术服务费对应的合格的增值税发票</span>。</p><p>乙方作为课程服务的提供方，负有向购买其课程服务的用户开具合规格发票的义务。乙方应当根据用户实际购买乙方课程的情况向用户开具合法、有效、等额的发票，如因乙方未向用户开具发票或开具发票不符合法律要求的，乙方须自行解决与用户之间的发票问题，与甲方无关。</p><p class="pro-guide">六、其他</p><p>如后续甲方给予乙方相应奖励、扶持等政策，则该等奖励、扶持等政策（包括但不限于政策实施的具体方式、政策实施数额及政策结算模式等）均会在甲方相关网站进行颁布，具体的政策以甲方再相关网站颁布的规则为准，乙方对此无异议且同意全部遵守。</p><p class="pro-guide">七、授权事项</p><p>乙方同意授权丙方，按乙方与甲方共同缔结的《腾讯课堂课程发布者注册协议》及其附件的规定在协议有效期内依甲方的指示直接对乙方与用户、甲方间在丙方的财付通账户进行款项止付和支付。</p> <p><strong>（以下无正文）</strong></p><p><br/></p><p class="pro-guide"><strong> 甲方：深圳市腾讯计算机系统有限公司</strong></p><p><br/></p><p class="pro-guide"><strong> 乙方：',bill.account||bill.bank_owner,'</strong></p><p><br/></p><p class="pro-guide"><strong> 丙方：财付通支付科技有限公司</strong></p><p><br/></p><p class="pro-no-indent"><strong>签约日期：<span class="underline">',bill.curYear,'</span>年<span class="underline">',bill.curMonth,'</span>月<span class="underline">',bill.curDay,"</span>日</strong></p></div>"),_$out_.join("")}}});
